$(document).ready(function(){var jsoninput=$("#json");var submit=$('button[type="submit"]');var form=$("form");submit.click(function(e){e.preventDefault();submit.addClass("disabled");submit.html(`Loading...`);var sum=0;var travel=false;var contact=false;$("input").each(function(e){var id=$(this).attr("id");var checked=$(this).is(":checked");if(checked){switch(id){case"travel":travel=true;break;case"contact":contact=true;break;default:sum++}}});var checkboxes={num_symptoms:sum,commercial_flight:travel,proximity:contact};reportSymptoms(checkboxes).then(function(){submit.removeClass("disabled");submit.html("Report")})})});